// Filters.js
import React from 'react';
import './Filters.css'

function Filters({onClick}) {
  return (
    <div className='filters_button' >
        <div className="filters">
            <select>
            <option>Filter by price</option>
            </select>
        </div>
        <div>
            <button onClick={onClick}>Apply</button>
        </div>
    </div>
  );
}

export default Filters;
